      text-align: center;
      margin-bottom: 20px;
    }
    #status-button {
      display: block;
      margin: 0 auto 30px;
      padding: 12px 24px;
      font-size: 18px;
      background-color: red;
      color: white;
      border: none;
      border-radius: 8px;
      cursor: default;
      transition: background-color 0.5s ease;
    }
    .ad-container {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(320px, 1fr));
      gap: 20px;
      justify-items: center;
    }
    .ad-box {
      background-color: #1e1e1e;
      padding: 15px;
      border-radius: 10px;
